    [],nt"revision_timestamp": "2016-07-27T22:23:25.392633",nt"name": "sherburne-national-wildlife-refuge-annual-narrative-report-calendar-year-1992",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Sherburne
    National Wildlife Refuge summarizes Refuge activities during the 1992 calendar year.
    The report begins with a summary of the yearu2019s highlights and climatic conditions.
    Land acquisition is also covered. The report includes a planning section which discusses
    research and investigations. Refuge administration is outlined; information about
    personnel, youth programs, manpower programs, volunteer programs, funding, safety,
    and technical assistance is given. Habitat management is also covered. Subjects
    include wetlands, forests, grasslands, fire management, pest control, and private
    lands. The wildlife section of the report discusses wildlife diversity, endangered
    species, threatened species, waterfowl, marsh birds, waterbirds, shorebirds, game
    mammals, animal control, marking, banding, and disease control. The public uses
    of the Refuge described in this report include outdoor classrooms, interpretive
    exhibits, hunting, fishing, trapping, and law enforcement. The equipment and facilities
    section of the report provides information about rehabilitation, major maintenance,
    equipment utilization/replacement, communications systems, and computer systems.
    Cooperative programs and items of interest are provided at the end. Refuge brochures
    are attached.",nt"license_title": "License Not Specified",nt"extras":
